import React from "react";
import {
  ContactContainer,
  LinkContainer,
  IconContainer,
} from "./Contact.style";
import { motion } from "framer-motion";
const Contact = () => {
  return (
    <ContactContainer>
      <LinkContainer whileHover={{ width: "200px" }}>
        <IconContainer>
          <i
            style={{ fontSize: "25px", lineHeight: "60px" }}
            class="fab fa-facebook-f"
          ></i>
        </IconContainer>
        <span>Facebook</span>
      </LinkContainer>
      <LinkContainer whileHover={{ width: "200px" }}>
        <IconContainer>
          <i
            class="fab fa-github"
            style={{ fontSize: "25px", lineHeight: "60px" }}
          ></i>
        </IconContainer>
        <span>Github</span>
      </LinkContainer>
      <LinkContainer whileHover={{ width: "200px" }}>
        <IconContainer>
          <i
            style={{ fontSize: "25px", lineHeight: "60px" }}
            class="fab fa-linkedin-in"
          ></i>
        </IconContainer>
        <span>LinkedIN</span>
      </LinkContainer>
    </ContactContainer>
  );
};
export default Contact;
